        15 16 20  17  5
        11 23 24  21  9
         7 19 22  18 13
         3 14 10  6   2
	*/

    if (all(greaterThanEqual(base_uv,ivec2(0))) && all(lessThanEqual(base_uv + STRIDE * FULL, iRes))) {
        bool del[DIM];
        vec2 sort[DIM];
        vec2 posv[DIM];
        ivec2 order[DIM];

        for (int i = 0; i < DIM; i++) {
            del[i] = false;
            sort[i] = vec2(0);
            posv[i] = vec2(0);
        }

        int MAX = DIM/4;

