            order[DIM-1] = ivec2(FULL/2);
            MAX = (DIM - 1)/4;
        }

        int ic = 0;
        int m  = 0;
        int id = FULL - 1;

        for (int i = 0; i < MAX; i++) {
            if (ic == id) {
                id = id - 2;
                ic = 0;
                m++;
            }
            order[4*i+REORDER(0)] = ivec2(ic+m,    id+m);
            order[4*i+REORDER(1)] = ivec2(id+m,    id-ic+m);
            order[4*i+REORDER(2)] = ivec2(id-ic+m, m);
            order[4*i+REORDER(3)] = ivec2(m,       ic+m);

            ic++;
        }

        for (int i = 0; i < FULL; i++) {
            for (int j = 0; j < FULL; j++) {
                posv[i + j * FULL] = T(base_uv + STRIDE*ivec2(i,j));
            }
        }

        #ifdef REVERSE_ORDER
        for (int i = DIM - 1; i >= 0; i--) {
        #else
        for (int i = 0; i < DIM; i++) {
        #endif
            vec2 closest = vec2(1e6);
            float closest_distance = 1e6;
            int closest_index = -1;

            #ifdef TARGET_EDGE
                vec2 tgt = vec2(order[i]) / float(FULL-1);
            #else
            	vec2 tgt = R(base_uv + STRIDE*order[i]);
            #endif

            int tgt_index = order[i].x + order[i].y * FULL;
            for (int j = 0; j < DIM; j++) { 
                float dist  = distance(posv[j],tgt);
                if (dist <= closest_distance && !del[j]) {
                    closest_index = j; 
                    closest = posv[j];
                    closest_distance = dist;
                }
            }
            del[closest_index] = true;
            sort[tgt_index] = closest;
        }

        new_pos = sort[subp.x + subp.y * FULL];
    }

    vec2 uv = fragCoord.xy / iResolution.xy;
    vec2 aspect = vec2(1, iResolution.y / iResolution.x);
    float delta = 1.0*tx.x;
    float noise  = simplex_noise(vec3(aspect * pos, TIME));
    float noiseY = simplex_noise(vec3(aspect * pos + vec2(0, delta), TIME));
    float noiseX = simplex_noise(vec3(aspect * pos + vec2(delta, 0), TIME));

    vec2 noiseV = vec2(noiseX, noiseY) - vec2(noise);

    if (iFrame < 2) {
        fragColor = 0.5 + vec4(vec2(uv.xy - 0.5).yx * vec2(1,-1),vec2(0));
    } else {
        vec2 curl = 1.0 * normalize(vec2(noiseV.y,-noiseV.x));
    	fragColor = vec4(mod(new_pos + curl * tx.xx,vec2(1)), vec2(0));    
    }   

}

