#define DIM (WIDTH * WIDTH)

#define TC 0.97  // time constant of the accumulator

void findClosest(ivec2 iuv, vec2 uv, inout float gravity, inout float minDist, inout vec2 closest) {
    for (int i = -WINDOW; i <= WINDOW; i++) {
        for (int j = -WINDOW; j <= WINDOW; j++) {
            vec2 pos = T(iuv + ivec2(i,j)).xy;
            float dist = distance(uv, pos);

            gravity += 10.0 / (dist*dist);

            if (dist < minDist) {
            	minDist = dist;
                closest = pos;
            }
        }
    }    
}

